import './App.css';

import Landing from './pages/Landing';
import { NaviBarComponent } from './components/NavigationBar';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';


function App() {
  return(
    <div className="App">
        <NaviBarComponent />
            <Routes>
                <Route exact path="/" element={<Landing />} />
            </Routes>
        </div>
  );
}

export default App;
